import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import {FormControl} from "react-bootstrap";
import InputGroup from 'react-bootstrap/InputGroup'
import ToggleButton from 'react-bootstrap/ToggleButton'
import icon from './media/icon_low_res.png'
import 'bootstrap/dist/css/bootstrap.css';
import './Home.css';

const passwords = ['test', 'test2', 'test3']

class Home extends React.Component { 

  constructor() {
    super();
    this.state = { 
      passwordEntered: '',
      rightPassword: false,
    };

    this.checkPassword = this.checkPassword.bind(this);

  }

  componentDidMount()
  {

  }

  checkPassword(input) {
    if(passwords.indexOf(input) > -1)
    {
      this.setState({rightPassword: true})
    }
  }



  render()
  {  




    return (

    <div >
      <div className='front'>
      <div className='vertical-center'>
        <center>
          <InputGroup className="mb-3">
          <FormControl
            placeholder="password"
            aria-label="password"
            aria-describedby="basic-addon2"
            onChange={e => {this.setState({passwordEntered: e.target.value})}}
            onKeyDown={e => {
              if(e.key === 'Enter')
              {
                this.checkPassword(e.target.value)
              }
            }}
          />
          </InputGroup>
          <ToggleButton variant="light" type="submit" onClick={this.checkPassword}>
            submit
          </ToggleButton>
        </center>
      </div>
      </div>
      <img src={icon} className='footer' alt='footer'></img>   
        <div id="foglayer_01" class="fog">
          <div class="image01"></div>
        </div>
        <div id="foglayer_02" class="fog">
          <div class="image01"></div>
        </div>
        <div id="foglayer_03" class="fog">
          <div class="image01"></div>
        </div>
        <div id="foglayer_04" class="fog">
          <div class="image01"></div>
        </div>



    </div>)




  }
}
export default Home;
